The IATA three-number airline accounting code and airline prefix code.

As per the provisions of IATA Resolution 767, a company may qualify for:
- a three-numeric airline accounting code for use on passenger traffic documents if engaged in providing passenger transportation services only;
- a three-numeric airline prefix code for use on cargo traffic documents if providing cargo transportation services only;
- an identical three-numeric airline accounting code and a three-numeric airline prefix code if providing both passenger and cargo transportation services.
